import React, { useEffect, useState } from "react";
import axios from "axios";

const DisplayStocks = () => {
  const [stocks, setStocks] = useState([]);

  const onClickHandle = (e) => {
    e.preventDefault();
    console.log("Click Triggered");
    axios
      .get("http://localhost:8000/api")
      .then((allStocks) => {
        console.log(allStocks.data.stock);
        setStocks(allStocks.data.stock);
      })
      .catch((err) => console.log(err));
  };
  return (
    <div>
      <table className="allPets">
        {stocks
          ? stocks.length > 1 &&
            stocks.map((stock, index) => (
              <div key={index}>
                <p>Bitcoin Exchange 1: {stock.Bit1}</p>
                <p>Bitcoin Exchange 2: {stock.Bit2}</p>
                <p>Ethereum Exchange 1: {stock.Eth1}</p>
                <p>Ethereum Exchange 2: {stock.Eth2}</p>
              </div>
            ))
          : "Stocks Loading"}
      </table>
    </div>
  );
};

export default DisplayStocks;
